import React, { useState } from "react";

import { Radio } from "antd";

export default function Content() {
  const [size, setSize] = useState('small');
  const onChange = (e) => {
    setSize(e.target.value);
  };

  return (
    <Radio.Group
          value={size}
          onChange={onChange}
          style={{
            marginBottom: 16,
          }}>
      <Radio.Button value="chipest">Самый дешевый</Radio.Button>
      <Radio.Button value="fas">Middle</Radio.Button>
      <Radio.Button value="Оптимальный">Large</Radio.Button>
    </Radio.Group>
  );
}
